import React, { useState, useEffect } from 'react'
import axios from 'axios'

const Simple = () => {

const [args, setArgs] = useState([])

useEffect(() => {
axios.get('http://localhost:4000/simple')
.then((res) => {
  setArgs(res.data)
})
.catch((err) => {
  console.log(err);
})
}, [])

  return (
<div>
  <h2>Examples of single arguments</h2>
  {args.map((arg) => (
    <div>
      <h2>Argument:</h2>
      <p>{arg.argument}</p>
      <h2>Untying:</h2>
      <p>{arg.untying}</p>
    </div>
  ))}
</div>
  )
}

export default Simple
